import React, { useState, useEffect } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  AppBar,
  Box,
  Button,
  Drawer,
  List,
  ListItem,
  ListItemText,
  IconButton,
  Menu,
  MenuItem
} from '@mui/material';
import {
  Home,
  MenuBook,
  AirplanemodeActive,
  People,
  Menu as MenuIcon,
  Close as CloseIcon,
  ArrowDropDown
} from '@mui/icons-material';

const MenuItems = [
  {
    title: 'Home',
    icon: <Home />,
    link: '/home'
  },
  {
    title: 'Sobre',
    icon: <MenuBook />,
    link: '/about',
    submenu: [
      {
        title: 'Diretoria',
        icon: <People />,
        link: '/direction'
      },
      {
        title: 'Espaco Aereo',
        icon: <AirplanemodeActive />,
        link: '/airspace'
      },
      {
        title: 'Estatuto',
        icon: <MenuBook />,
        link: '/statute'
      },
      {
        title: 'HistÃ³ria',
        icon: <MenuBook />,
        link: '/about'
      },
      {
        title: 'Regimento Interno',
        icon: <MenuBook />,
        link: '/regiment'
      }
    ]
  },
  {
    title: 'Associados',
    icon: <People />,
    link: '/login'
  }
];

export const Navbar: React.FC = () => {
  const [isMenubarOpen, setMenubarOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);

  const toggleDrawer = () => {
    setMenubarOpen(!isMenubarOpen);
  };

  const handleMenuClick = (event: React.MouseEvent<HTMLElement>, item: any) => {
    setAnchorEl(event.currentTarget);
  };

  const handleCloseMenu = () => {
    setAnchorEl(null);
  };

  useEffect(() => {
    const handleResize = () => {
      if (window.innerWidth >= 992 && isMenubarOpen) {
        setMenubarOpen(false);
      }
    };
    window.addEventListener('resize', handleResize);
    handleResize();
    return () => window.removeEventListener('resize', handleResize);
  }, [isMenubarOpen]);

  return (
    <AppBar position="static" sx={{ backgroundColor: 'white', boxShadow: 0.51 }}>
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          padding: '0 1rem'
        }}
      >
        {/* Menu Desktop */}
        <Box sx={{ display: { xs: 'none', sm: 'flex'} }}>
          {MenuItems.map((item) =>
            item.submenu ? (
              <Button
                key={item.title}
                sx={{ color: '#424242', margin: '0 1rem' }}
                onClick={(e) => handleMenuClick(e, item)}
              >
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  {item.icon}
                  <Box sx={{ marginLeft: 0.5 }}>{item.title}</Box>
                  <ArrowDropDown sx={{ marginLeft: 0.5 }} />
                </Box>
              </Button>
            ) : (
              <Button
                key={item.title}
                sx={{ color: '#424242', margin: '0 1rem' }}
                component={RouterLink}
                to={item.link}
              >
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  {item.icon}
                  <Box sx={{ marginLeft: 0.5 }}>{item.title}</Box>
                </Box>
              </Button>
            )
          )}
        </Box>

        {/* Menu Mobile */}
        <IconButton
          sx={{ color: '#424242', display: { xs: 'block', sm: 'none' } }}
          onClick={toggleDrawer}
        >
          {isMenubarOpen ? (
            <CloseIcon sx={{ fontSize: 36 }} />
          ) : (
            <MenuIcon sx={{ fontSize: 36 }} />
          )}
        </IconButton>
      </Box>

      {/* Menu Dropdown (for submenus) */}
      <Menu
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleCloseMenu}
        MenuListProps={{
          'aria-labelledby': 'basic-button'
        }}
      >
        {anchorEl &&
          MenuItems.find(
            (item) => item.title === anchorEl!.textContent
          )!.submenu!.map((submenuItem) => (
            <MenuItem key={submenuItem.title} onClick={handleCloseMenu}>
              <RouterLink
                to={submenuItem.link}
                style={{ color: '#424242', textDecoration: 'none' }}
              >
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  {submenuItem.icon}
                  <Box sx={{ marginLeft: 1.5 }}>{submenuItem.title}</Box>
                </Box>
              </RouterLink>
            </MenuItem>
          ))}
      </Menu>

      {/* Mobile Drawer Menu */}
      <Drawer anchor="right" open={isMenubarOpen} onClose={toggleDrawer}>
        <List sx={{ width: 250 }}>
          {MenuItems.map((item) =>
            item.submenu ? (
              <ListItem                
                key={item.title}
                onClick={(e) => handleMenuClick(e, item)}
              >
                <Box
                  sx={{
                    display: 'flex',
                    alignItems: 'center',                    
                    padding: '0.5rem 1rem'
                  }}
                >
                  {item.icon}
                  <ListItemText primary={item.title} sx={{ marginLeft: 1 }} />
                </Box>
              </ListItem>
            ) : (
              <ListItem key={item.title}>
                <RouterLink
                  to={item.link}
                  style={{
                    color: '#424242',
                    display: 'flex',
                    alignItems: 'center',
                    textDecoration: 'none',
                    padding: '0.5rem 1rem'
                  }}
                >
                  {item.icon}
                  <ListItemText primary={item.title} sx={{ marginLeft: 1 }} />
                </RouterLink>
              </ListItem>
            )
          )}
        </List>
      </Drawer>
    </AppBar>
  );
};
